import { Layout } from 'antd';

export default function LayoutBasic(props) {
    const { children } = props;
    return (
        <Layout>
            <h2>Menu Sider</h2>
            <div>Contenido...</div>
            <h5>Footer....</h5>
        </Layout>
    );
}
